import Button from '@material-ui/core/Button';

const Buttons = () => {

    var running = false;

    const handleStart = () => {
        running = true;
    }

    const handleStop = () => {
        running = false;
    }

    return (
        <div className="Buttons">
            <Button variant="contained" color="primary" onClick={handleStart}>
                Optimize
            </Button>
            <Button variant="contained" disabled={running} color="default" onClick={handleStop}>
                Stop
            </Button>
        </div>
    );
};

export default Buttons;
